#include<bits/stdc++.h>
using namespace std;
//#define int long long
const int p=998244353;
int n,a[5005],dp[5005][10005];
int pw[10005];
int s[5005][10005];
signed main(){
	freopen("polygon.in","r",stdin),freopen("polygon.out","w",stdout);
	//freopen("ploygon.in","r",stdin),freopen("poygon.out","w",stdout);
	cin>>n;
	pw[0]=1;
	for (int i=1;i<=10000;i++)pw[i]=(pw[i-1]<<1)%p;
	for (int i=1;i<=n;cin>>a[i++]);
	sort(a+1,a+n+1);
	int ans=0;
	for (int i=1;i<=n;i++){
		for (int j=2*a[n]+1;j>=0;j--){
			if (j<=a[i]){
				dp[i][j]=pw[i-1];
			}else{
				dp[i][j]=s[i-1][j-a[i]];
			}
			s[i][j]+=s[i-1][j]+dp[i][j];
			s[i][j]%=p;
		}
		ans+=dp[i][2*a[i]+1];
		ans%=p;
	}
	cout<<ans;
	return 0;
}
